♦️ ۱۲۳ اینفلوئنسر ۲.۳ هزار میلیارد درآمد داشتند

🔹سخنگوی سازمان امور مالیاتی با بیان اینکه مجموع تراکنش‌های واریزی برای ۱۲۳ اینفلوئنسر در سال ۱۴۰۰ بیش از ۲.۳ هزار میلیارد تومان بوده‌ است، گفت: برای این افراد حدود ۱۷ میلیارد تومان مالیات تشخیص داده شده که ۲۳ نفر از اینفلوئنسرها این مالیات را پذیرفتند./ ایلنا
@AkhbareFori | Link

♦️اتحادیه اروپا با ۴ روز تأخیر اهانت به قرآن را محکوم کرد

🔹اتحادیه اروپا امروز به دنبال واکنش و محکومیت گسترده به قرآن سوزی در سوئد که با مجور و حمایت دولت این کشور در روز عید قربان صورت گرفت، بیانیه‌ای صادر کرد و در آن ضمن محکوم کردن این اقدام، آن را «زشت و تحریک‌کننده» دانست.
